import React from 'react';
import { ShoppingCartIcon, MagnifyingGlassIcon } from '@heroicons/react/24/solid';

interface Props {

}

const NavigationBar: React.FC<Props> = () => {
    return (
        <>
            <header className="shadow-lg shadow-slate-200 h-30 ">
                <div className="flex flex-row justify-between">

                    <div className="ml-10">
                    </div>

                    <div className="text-center">
                        <button className="mx-4 h-30 p-3 font-raleway hover:bg-stone-400 hover:text-stone-50">Home</button>
                        <button className="mx-4 h-30 p-3 font-raleway hover:bg-stone-400 hover:text-stone-50">Products</button>
                        <button className="mx-4 h-30 p-3 font-raleway hover:bg-stone-400 hover:text-stone-50">Blog</button>
                        <button className="mx-4 h-30 p-3 font-raleway hover:bg-stone-400 hover:text-stone-50">About</button>
                    </div>

                    <div className="mr-10">
                        <div className="flex">
                            <button className="h-30 p-3 hover:bg-stone-400 hover:text-stone-50">
                                <MagnifyingGlassIcon className="h-6 w-6 mx-3 text-black-500" />
                            </button>
                            <button className="h-30 p-3 hover:bg-stone-400 hover:text-stone-50">
                                <ShoppingCartIcon className="h-6 w-6 mx-3 text-black-500" />
                            </button>
                        </div>
                    </div>
                </div>
            </header>
        </>
    );
}

export default NavigationBar;
